import React from 'react';

const Footer = () => {
    return (
        <div>
            <footer>
                <nav className="navbar fixed-bottom text-bg-dark">
                    {/* <div className="container-fluid">
                    
                    </div> */}
                    <p className="text-center">Center aligned text on all viewport sizes.</p>
                </nav>
            </footer>
        </div>
    );
}

export default Footer;
